  ngOnInit(): void {
    const theme = localStorage.getItem('theme');
    if (theme) { this.changeTheme(theme) } else {this.changeTheme(this.theme)};
  }
  
  transformToTitleCase(input: string): string {
    return input.split('_').map(word => word.charAt(0).toUpperCase() + word.slice(1)).join(' ');
  }

  changeTheme(val:string){
    this.theme = val;
    this.themeSubject.next(this.theme);
    localStorage.setItem('theme', this.theme);
  }

  generatePDF(size: string, elementId: string): void {
    const element: any = document.getElementById(elementId);
    html2canvas(element).then((canvas) => {
      const imgData = canvas.toDataURL('image/png');
      const pdf = new jspdf.jsPDF(this.orientation, 'mm', size);
      const imgWidth = pdf.internal.pageSize.getWidth();
      const imgHeight = pdf.internal.pageSize.getHeight();
      pdf.addImage(imgData, 'PNG', 0.5, 0.5, imgWidth, imgHeight);
      const pdfBlob = pdf.output('blob');
      const pdfUrl = URL.createObjectURL(pdfBlob);
      window.open(pdfUrl);
    });
  }  

  transform(value: string, limit: number): string {
    if(value && limit) {
      return value.length > limit ? value.substring(0, limit) + '...' : value;
    }
    return value
  }

  capitalizeFirstLetter(str: string): string {
    if (typeof str !== 'string' || !str) return '';
    return str.charAt(0).toUpperCase() + str.slice(1);
  }

